import React from "react";
import styled, { css }  from "styled-components";

export default function Header() {
    return (
        <div>
            <HeaderContainer>
                <img src="/Logo/logo.svg" alt="logo"></img>
            </HeaderContainer>
        </div>
    )
}

const HeaderContainer = styled.div`
    width: 80%,
    hight: 40px,
    margin: 0px auto,
    padding: 10px 0px,
    display: flex;
    flex-diraction: row;
`;

const HeaderContent = styled.ul`

